package com.res.bean;public class ResMenus implements java.io.Serializable {	private static final long serialVersionUID = 1L;	private Integer pkId;	private Integer iId;	private String iNo;	private String mMoney;	private String mMemo;	private String mDate;	private Integer mCreatetime;	private Integer mAdduser;			public Integer getPkId() {		return pkId;	}	public void setPkId(Integer pkId) {		this.pkId = pkId;	}	public Integer getiId() {		return iId;	}	public void setiId(Integer iId) {		this.iId = iId;	}	public String getiNo() {		return iNo;	}	public void setiNo(String iNo) {		this.iNo = iNo;	}	public String getmMoney() {		return mMoney;	}	public void setmMoney(String mMoney) {		this.mMoney = mMoney;	}	public String getmMemo() {		return mMemo;	}	public void setmMemo(String mMemo) {		this.mMemo = mMemo;	}	public String getmDate() {		return mDate;	}	public void setmDate(String mDate) {		this.mDate = mDate;	}	public Integer getmCreatetime() {		return mCreatetime;	}	public void setmCreatetime(Integer mCreatetime) {		this.mCreatetime = mCreatetime;	}	public Integer getmAdduser() {		return mAdduser;	}	public void setmAdduser(Integer mAdduser) {		this.mAdduser = mAdduser;	}}